import React from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Navigate,
  Route,
} from 'react-router-dom'
import { Home, Browse, Signin, Signup } from './pages/index'
import * as ROUTES from './constants/routes'

export default function App() {
  const user = {}
  const RequiredAuth = (user, loggedInPath, children) => {
    return !user ? <Navigate to={loggedInPath} /> : children
  }
  return (
    <Router>
      <Routes>
        <Route
          path={ROUTES.SIGN_IN}
          element={
            <RequiredAuth user={user} loggedInPath={ROUTES.BROWSE}>
              <Signin />
            </RequiredAuth>
          }
        />
        <Route
          path={ROUTES.SIGN_UP}
          element={
            <RequiredAuth user={user} loggedInPath={ROUTES.BROWSE}>
              <Signup />
            </RequiredAuth>
          }
        />
        <Route
          path={ROUTES.BROWSE}
          element={
            <RequiredAuth user={user} loggedInPath={ROUTES.BROWSE}>
              <Browse/>
            </RequiredAuth>
          }
        />
        <Route
          path={ROUTES.HOME}
          element={
            <RequiredAuth user={user} loggedInPath={ROUTES.BROWSE}>
              <Home />
            </RequiredAuth>
          }
        />
      </Routes>
    </Router>
  )
}
